graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Start</b></td></tr></table>>, pad=0.5, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "Process" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Process</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "Complete" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Complete</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "Retry" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Retry</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "Failed" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Failed</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "Start" -> "Process" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Process" -> "Complete" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>weight: 0.9; condition: &quot;success&quot;;</b></td></tr><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">weight</td><td align="left" balign="left">0.9</td></tr><tr><td align="left" balign="left">condition</td><td align="left" balign="left">success</td></tr></table></td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD", weight="0.9", condition="success"];
  "Process" -> "Retry" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>weight: 0.1; condition: &quot;error&quot;;</b></td></tr><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">weight</td><td align="left" balign="left">0.1</td></tr><tr><td align="left" balign="left">condition</td><td align="left" balign="left">error</td></tr></table></td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD", weight="0.1", condition="error"];
  "Retry" -> "Process" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>attempts: 3;</b></td></tr><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">attempts</td><td align="left" balign="left">3</td></tr></table></td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD", attempts="3"];
  "Retry" -> "Failed" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>exhausted: true;</b></td></tr><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">exhausted</td><td align="left" balign="left">true</td></tr></table></td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD", exhausted="true"];
}
